import { Injectable } from '@angular/core';
import { HospitalisationDepuitLaDernierVisite } from '../models/HospitalisationDepuitLaDernierVisite';
import { HttpClient, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class HospitdepvisiteService {
  private apiUrl = 'https://localhost:7129/api/HospitalisationDepuitLaDernierVisites';

  constructor(private http: HttpClient) { }

  add(HospitalisationDepuitLaDernierVisite: HospitalisationDepuitLaDernierVisite): Observable<HttpResponse<any>> {
    console.log('Creating it with data:', HospitalisationDepuitLaDernierVisite);

    return this.http.post<any>(`${this.apiUrl}/add`, HospitalisationDepuitLaDernierVisite, { observe: 'response' });
  }
}
